It does seem that the `btcli st list` command in btcli does reflect the correct staked alpha balance. That command uses `StakeInfoRuntimeApi.get_stake_info_for_coldkeys` , not `subtensorModule.alpha`.

Basically my point is there might be something wrong. with the subtensorModule.alpha method and nothing wrong with the `fixed_to_float` method in the PR.

